import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
     <h1>Bienvenidos al curso de ASP .NET Core y React Hooks</h1>
     <input type="text" name="nombre"/>
    </div>
  );
}

export default App;
